const eggDOM = fetchSync.dom('https://www.trumpseggprices.com/');
let dozenEggPrice = null;

try {
    const chartDataElement = eggDOM.window.document.getElementById('chart-data');
    if (chartDataElement) {
        const chartDataText = chartDataElement.textContent;
        if (chartDataText) {
            const chartData = JSON.parse(chartDataText);
            const prices = chartData.prices;
            dozenEggPrice = prices[prices.length - 1];
        }
    }
} catch (e) {
    print(`Error extracting egg price: ${e.message}`);
}

if (!dozenEggPrice) {
    dozenEggPrice = 5.51;
    print("Could not extract egg price dynamically.");
}

const teslaDOM = fetchSync.dom('https://finance.yahoo.com/quote/TSLA/');
let teslaPrice = null;

try {
    const priceElement = teslaDOM.window.document.querySelector('[data-testid="qsp-price"]');
    if (priceElement) {
        const priceText = priceElement.textContent;
        if (priceText) {
            const match = priceText.match(/(\d+\.\d+)/);
            if (match && match[1]) {
                teslaPrice = parseFloat(match[1]);
            }
        }
    }
} catch (e) {
    print(`Error extracting Tesla price: ${e.message}`);
}

if (!teslaPrice) {
    teslaPrice = 231.39;
    print("Could not extract Tesla price dynamically.");
}

const singleEggPrice = dozenEggPrice / 12;
const eggsPerTeslaShare = Math.floor(teslaPrice / singleEggPrice);

print(`{g}{bo}One Tesla share = ${eggsPerTeslaShare} eggs {/}`);
